<div class="entities" style="line-height: 2.5; direction: ltr">Natriuretic peptide receptor A signaling regulates stem cell recruitment and angiogenesis : a model to study linkage between inflammation and tumorigenesis . Natriuretic peptide receptor A ( NPRA ) , the signaling receptor for the cardiac hormone , atrial natriuretic peptide ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01160
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , is expressed abundantly in inflamed / injured tissues and tumors . NPRA deficiency substantially decreases tissue inflammation and inhibits tumor growth . However , the precise mechanism of NPRA function and whether it links inflammation and tumorigenesis remains unknown . Since both injury repair and tumor growth require stem cell recruitment and angiogenesis , we examined the role of NPRA signaling in tumor angiogenesis as a model of tissue injury repair in this study . In in vitro cultures , aortas from NPRA-KO mice show significantly lower angiogenic response compared to wild-type counterparts . The NPRA antagonist that decreases NPRA expression , inhibits lipopolysaccharide-induced angiogenesis . The reduction in angiogenesis correlates with decreased expression of vascular endothelial growth factor and chemokine ( C-X-C motif ) receptor 4 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P61073
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) implicating a cell recruitment defect . To test whether NPRA regulates migration of cells to tumors , DB05914 ( MSCs ) were administered i . v . , and the results showed that MSCs fail to migrate to the tumor microenvironment in NPRA-KO mice . However , coimplanting tumor cells with MSCs increases angiogenesis and tumorigenesis in NPRA-KO mice , in part by promoting expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P61073
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and its ligand , stromal cell-derived factor 1 . Taken together , these results demonstrate that NPRA signaling regulates stem cell recruitment and angiogenesis leading to tumor growth . Thus , NPRA signaling provides a key linkage between inflammation and tumorigenesis , and NPRA may be a target for drug development against cancers and tissue injury repair .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Coronary atherosclerosis : current therapeutic approaches and future trends . Invasive cardiovascular procedures , such as percutaneous translumenal coronary angioplasty ( PTCA ) and aorto-coronary bypass surgery ( ACBS ) , that are currently employed in treating the coronary stenosis or occlusion caused by atherosclerosis represent a major therapeutic advance for managing coronary heart disease ( Q8NE62 ) . However , the cellular proliferative response and associated intimal hyperplasia that can follow the damage to blood vessels that occurs with these procedures leads to late complications which can not be effectively controlled by presently available drugs . Hence , a new approach is required for managing these complications , termed &quot; restenosis &quot; ( in the case of PTCA ) or &quot; stenosis &quot; ( in the case of ACBS ) . Existing drug therapy is reviewed and some new approaches to this problem are provided herein . Further studies of growth factors and other substances that influence the cellular proliferative response that follows injury to the blood vessel wall could lead to the development of effective therapy . Inhibition of intimal hyperplasia and / or acceleration of endothelial cell re-growth provide a basis for such new approaches . Platelet-derived growth factor ( PDGF ) and basic fibroblast growth factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09038
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , as well as DB00435 ( s ) ( EDRF ) and calcitonin gene-related peptide ( P8 0511 ) are among the substances discussed . Modification of certain currently available drugs ( e . g . Ca ( 2 + ) - antagonists ) could also be of value in meeting this therapeutic demand .</div>

 and high levels of circulating 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in OCCA patients may explain the frequent occurrence of hypercalcemia of malignancy and thromboembolic events in OCCA . We describe amplification of several receptor tyrosine kinases , most notably MET , suggesting other potential therapeutic targets . We report sustained clinical and functional imaging responses in two OCCA patients with chemotherapy-resistant disease who were treated with sunitinib , thus showing significant parallels with renal clear cell cancer . CONCLUSIONS : Our findings highlight important therapeutic targets in OCCA , suggest that more extensive clinical trials with sunitinib in OCCA are warranted , and provide significant impetus to the growing realization that OCCA is molecularly and clinically distinct to other forms of ovarian cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Molecular targets and regulators of cardiac hypertrophy . Cardiac hypertrophy is one of the main ways in which cardiomyocytes respond to mechanical and neurohormonal stimuli . It enables myocytes to increase their work output , which improves cardiac pump function . Although cardiac hypertrophy may initially represent an adaptive response of the myocardium , ultimately , it often progresses to ventricular dilatation and heart failure which is one of the leading causes of mortality in the western world . A number of signaling modulators that influence gene expression , apoptosis , cytokine release and growth factor signaling , etc . are known to regulate heart . By using genetic and cellular models of cardiac hypertrophy it has been proved that pathological hypertrophy can be prevented or reversed . This finding has promoted an enormous drive to identify novel and specific regulators of hypertrophy . In this review , we have discussed the various molecular signal transduction pathways and the regulators of hypertrophic response which includes calcineurin , cGMP , NFAT , natriuretic peptides , histone deacetylase ,

 activity . At the target dose of 6 mg / 24 hours , tyramine dietary restrictions are not needed . Short-term treatment with fixed ( 6 mg / 24 hours ) or flexible ( 6 , 9 or 12 mg / 24 hours ) doses of selegiline transdermal system was superior to placebo on most measures of antidepressant activity in 6 - or 8 - week , randomised , double-blind , multicentre studies in adult outpatients with major depressive disorder ( MDD ) . Likewise , long-term treatment with a fixed dose of selegiline transdermal system 6 mg / 24 hours was superior to placebo as maintenance therapy in a 52 - week , randomised , double-blind , multicentre , relapse-prevention trial in patients with MDD .

<h2 style="margin: 0">20</h2>

 protein as an attractive molecular target in APL .</div>

 derivatives induce apoptosis by depleting ER Ca ( 2 + ) stores in vascular endothelial cells . BACKGROUND AND PURPOSE :

 derivatives are blockers of the Na ( + ) / H ( + ) exchanger ( NHE ) and at micromolar concentrations have protective effects on cardiac and brain ischaemia / reperfusion injury but at higher concentrations also induce apoptosis . Here , we aimed to elucidate the mechanism related to this cytotoxic action . EXPERIMENTAL APPROACH : We quantified the expression of genes associated with endoplasmic reticulum ( ER ) stress and measured changes in luminal ER Ca ( 2 + ) concentration ( [ Ca ( 2 + ) ] ( ER ) ) with a ' cameleon ' indicator , D1ER . KEY RESULTS :

 derivatives induced apoptosis in vascular endothelial cells , an effect that increased at alkaline extracellular pH . The potency order for cytotoxicity was 5 - ( N , N-hexamethylene ) - amiloride ( HMA ) &gt; 5 - ( N-methyl-N-isobutyl ) amiloride &gt; 5 - ( N-ethyl-N-isopropyl ) amiloride ( EIPA ) &gt; &gt; amiloride . HMA dose-dependently increased the transcription of the ER stress genes

 and

 and rapidly depleted [ Ca ( 2 + ) ] ( ER ) , mimicking the effects of the sarco / endoplasmic reticulum ATPase ( SERCA ) inhibitor thapsigargin . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - specific inhibitor HOE 694 inhibited NHE activity by 87 % but did not alter [ Ca ( 2 + ) ] ( ER ) . The decrease in [ Ca ( 2 + ) ] ( ER ) evoked by amiloride derivatives was also observed in HeLa cells and was mirrored by an increase in cytosolic Ca ( 2 + ) concentration . CONCLUSIONS AND IMPLICATIONS :

 derivatives disrupt ER and cytosolic Ca ( 2 + ) homeostasis by a mechanism unrelated to NHE inhibition , most likely by interfering with the activity of SERCA . We propose that ER Ca ( 2 + ) depletion and subsequent ER stress provide a rationale framework for the apoptotic effects of amiloride derivatives .</div>
